import React, { Component } from "react";
import NavBar, { ElementsWrapper } from "react-scrolling-nav";
import { Unity, useUnityContext } from "react-unity-webgl";

class SideBar extends Component {
  render() {
    const navbarItems = [
      {
        label: "Item 1",
        target: "item-1"
      },
      {
        label: "Item 2",
        target: "item-2"
      },
      {
        label: "Item 3",
        target: "item-3"
      }
    ];
    const { unityProvider } = useUnityContext({
      loaderUrl: "/BirdGangGame/Build/BirdGangGame.loader.js",
      dataUrl: "/BirdGangGame/Build/BirdGangGame.data",
      frameworkUrl: "/BirdGangGame/Build/BirdGangGame.framework.js",
      codeUrl: "/BirdGangGame/Build/BirdGangGame.wasm",
    });
    return (
      <div>
        <NavBar items={navbarItems} offset={-80} duration={500} delay={0} />
        <div className="container">
          <ElementsWrapper items={navbarItems}>
            <div name="item-1" className="item">
              <Unity style = {{width: "80%", position: 'absolute', left: '50%', top: '70%',transform: 'translate(-50%, -50%)', justifySelf:"center", alignSelf:"center",}} unityProvider={unityProvider} />
            </div>
            <div name="item-2" className="item">
              item 2
            </div>
            <div name="item-3" className="item">
              item 3
            </div>
          </ElementsWrapper>
        </div>
      </div>
    );
  }
}

export default SideBar;
